import './TopMain.css'
import { useNavigate } from "react-router-dom";

function TopMain(){

    return (
        <header class='Top'>
            <button class='title'>
                <h1 id='title'>Jump Up Happy School</h1>
            </button>
            <button class='outButton'>
                로그아웃
            </button>
        </header>
    );
}

export default TopMain;
